if (!this.configured) {
	//console.log(this)
    // Initial configuration
    var $this = this;
    this.configured = true;
    this.stop();    
    this.getDuration = Number(this.m_frameCount);
    this.next = function() {
		$this.showmehowloaded = false;
		if ($this.m_currentFrameNo < $this.getDuration) {
			if ($this.playing)
				$this.gotoAndStop(getNextFrame());
			else
				$this.play()
		}
    }
    this.prev = function() {
		$this.gotoAndStop(getPreviousFrame());
		$this.stop();
    }
    this.pause = function() {
		if ($this.playing)
			$this.stop();
	}

	this.showText = function() {}
	this.hideText = function() {}
	this.changeText = function() {}
	this.showClaim = function() {}
	this.hideClaim = function() {}

    //this.nextBtn.click(this.next);
    //this.prevBtn.click(this.prev);


	function getPreviousFrame() {
		for (var i=$this._labels.length-1; i>=0; --i) {
			var label = $this._labels[i];
			var frameNum = Number(label.frameNum)+1;
			if (label.name === "stop" && $this.m_currentFrameNo > frameNum)
				return frameNum;
		}
	}
	function getNextFrame() {
		for (var i=0; i<$this._labels.length;++i) {
			var label = $this._labels[i];
			var frameNum = Number(label.frameNum)+1;
			if (label.name === "stop" && $this.m_currentFrameNo < frameNum)
				return frameNum;
		}
	}
}


